import { createTheme } from "@mui/material";

export const Colors={
    primary : "#5f2c3e",
    // primary : "#E6E6FA",
    secondary : "#d1adcc",
    success : "#4CAF50",
    info : "#00a2ff",
    danger : "#FF5722",
    warning : "#FFC107",
    dark : "#0e1d20",
    light : "#aaa",
    muted : "abafb3",
    border : "DDDFE1",
    inverse : "2F3D4A",
    shaft : "#333",
    // grays
    dim_grey : "#696969",
    dove_gray : "#d5d5d5",
    light_gray : "rgb(230,230,230)",
    // solid color
    white : "#fff",
    black : "#000",
    
}

const theme =  createTheme({

    palette: {
        primary: {
            main: Colors.primary
        },
        secondary: {
            main: Colors.secondary
        }
    }

})

export default theme;
